--
-- Name: active_representatives; Type: VIEW; Schema: public; Owner: ashishtandon
--

CREATE VIEW public.active_representatives AS
 SELECT j.code AS jurisdiction_code,
    j.name AS jurisdiction_name,
    j.level AS jurisdiction_level,
    count(r.id) AS representative_count
   FROM (public.jurisdictions j
     JOIN public.representatives r ON ((j.id = r.jurisdiction_id)))
  WHERE (r.is_active = true)
  GROUP BY j.id, j.code, j.name, j.level
  ORDER BY j.level, j.name;


