--
-- Name: representative_details _RETURN; Type: RULE; Schema: public; Owner: ashishtandon
--

CREATE OR REPLACE VIEW public.representative_details AS
 SELECT r.id,
    r.name,
    r.role,
    r.district,
    r.party,
    r.image_url,
    r.biography,
    r.start_date,
    r.end_date,
    r.is_active,
    j.code AS jurisdiction_code,
    j.name AS jurisdiction_name,
    j.level AS jurisdiction_level,
    count(DISTINCT cd.id) AS contact_count,
    count(DISTINCT l.id) AS link_count,
    count(DISTINCT s.id) AS source_count
   FROM ((((public.representatives r
     JOIN public.jurisdictions j ON ((r.jurisdiction_id = j.id)))
     LEFT JOIN public.contact_details cd ON ((r.id = cd.representative_id)))
     LEFT JOIN public.links l ON ((r.id = l.representative_id)))
     LEFT JOIN public.sources s ON ((r.id = s.representative_id)))
  GROUP BY r.id, j.code, j.name, j.level;


